int Get_Boundary_Condition_Code(const ARRAY<bool,FACE_INDEX<3> >& psi_N)
{
    typedef VECTOR<int,3> TV_INT;
    int code=0;

    if(!psi_N(FACE_INDEX<3>(1,TV_INT(2,1,1)))) code+=1;
    if(!psi_N(FACE_INDEX<3>(1,TV_INT(2,1,2)))) code+=2;
    if(!psi_N(FACE_INDEX<3>(1,TV_INT(2,2,1)))) code+=4;
    if(!psi_N(FACE_INDEX<3>(1,TV_INT(2,2,2)))) code+=8;

    if(!psi_N(FACE_INDEX<3>(2,TV_INT(1,2,1)))) code+=16;
    if(!psi_N(FACE_INDEX<3>(2,TV_INT(1,2,2)))) code+=32;
    if(!psi_N(FACE_INDEX<3>(2,TV_INT(2,2,1)))) code+=64;
    if(!psi_N(FACE_INDEX<3>(2,TV_INT(2,2,2)))) code+=128;

    if(!psi_N(FACE_INDEX<3>(3,TV_INT(1,1,2)))) code+=256;
    if(!psi_N(FACE_INDEX<3>(3,TV_INT(1,2,2)))) code+=512;
    if(!psi_N(FACE_INDEX<3>(3,TV_INT(2,1,2)))) code+=1024;
    if(!psi_N(FACE_INDEX<3>(3,TV_INT(2,2,2)))) code+=2048;

    return code;
}

